import React, { Component } from 'react'
import Resevation from './Reservation'


class Reservations extends Component {
    constructor(props){
        super(props)
        this.state = {
            key:0
        }

        this.chengkey = this.chengkey.bind(this)
    }
    render() {
        if(this.props.users.length > 0)
            return (<div>
                {this.props.users.map((el)=> (
                    this.chengkey(el)

                ))}
            </div>)
        else
        return(<div className='user'><h3>Not found</h3></div>)
    }

    chengkey(el){
        key = this.state.key
        key += 1;
        this.setState({key: key})
       return <Resevation user={el} key={this.state.key} />
    }

}

export default Reservations
